                            `CreateTime` datetime DEFAULT NULL COMMENT '创建时间',
                            `ModifyTime` datetime DEFAULT NULL COMMENT '更新时间',
                            `Creator` bigint DEFAULT NULL COMMENT '创建人员',
                            `Modifier` bigint DEFAULT NULL COMMENT '更新人员',
                            `Remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
                            PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='流程表单';

