-- ----------------------------
-- Table structure for sys_quartz_job
-- ----------------------------
DROP TABLE IF EXISTS `sys_quartz_job`;
CREATE TABLE `sys_quartz_job` (
                                  `Id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '日志id',
                                  `JobName` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '任务名称',
                                  `JobGroup` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '任务组名',
                                  `Description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '描述',
                                  `InvokeTarget` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '调用目标字符串',
                                  `CronExpression` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'cron执行表达式',
                                  `ConCurrent` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否并发执行（0允许 1禁止）',
                                  `Status` int DEFAULT NULL COMMENT '任务状态（0正常 1暂停）',
                                  `Creator` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
                                  `CreateTime` datetime DEFAULT NULL,
                                  `Modifier` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
                                  `ModifyTime` datetime DEFAULT NULL,
                                  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='定时任务调度表';

-- ----------------------------
-- Records of sys_quartz_job
-- ----------------------------
BEGIN;
INSERT INTO `sys_quartz_job` (`Id`, `JobName`, `JobGroup`, `Description`, `InvokeTarget`, `CronExpression`, `ConCurrent`, `Status`, `Creator`, `CreateTime`, `Modifier`, `ModifyTime`) VALUES ('468634278062854144', 'testHasParam', 'DEFAULT', 'testHasParam', 'com.ares.quartz.jobs.TestJob.testHasParam(\'job\',\'run\')', '0 0/1 * * * ?', '1', 1, '1', '2020-09-23 06:32:09', '1', '2021-12-30 02:26:40');
COMMIT;

-- ----------------------------
-- Table structure for sys_quartz_job_log
-- ----------------------------
DROP TABLE IF EXISTS `sys_quartz_job_log`;
CREATE TABLE `sys_quartz_job_log` (
                                      `Id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',
                                      `JobName` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '任务名称',
                                      `JobGroup` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '任务组名',
                                      `InvokeTarget` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '调用目标字符串',
                                      `JobMessage` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '日志信息',
                                      `Status` int DEFAULT NULL COMMENT '执行状态（0正常 1失败）',
                                      `ExceptionInfo` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '异常信息',
                                      `StartTime` datetime DEFAULT NULL COMMENT '开始时间',
                                      `FinishTime` datetime DEFAULT NULL COMMENT '结束时间',
                                      PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='定时任务调度日志表';

